import React, { useEffect, useState } from "react";
import { Route, Routes } from "react-router-dom";
import Header from "./components/header/header";
import Footer from "./components/footer/footer";
import Components from "./views/components/components";
import SurveyGender from "./components/SurveyGender";
import SurveyBirthYear from "./components/SurveyBirthYear";
import SurveyInterest from "./components/SurveyInterest";
import SurveyResult from "./components/SurveyResult";
import Main from "./components/Main";
import Mypage from "./components/Mypage";
import WishList from "./components/WishList";
import Preview from "./components/Preview";

function App() {
  const [userSurvey, setUserSurvey] = useState({});
  const [gender, setGender] = useState("");
  const [birthYear, setBirthYear] = useState();
  const [interest, setInterest] = useState([]);

  return (
    <div>
      <Header />
      <Routes>
        <Route path="/haru" element={<Preview />} />
        <Route
          path="/haru/survey"
          element={<SurveyGender gender={gender} setGender={setGender} />}
        />
        <Route
          path="/haru/survey/1"
          element={
            <SurveyBirthYear
              birthYear={birthYear}
              setBirthYear={setBirthYear}
              gender={gender}
            />
          }
        />
        <Route
          path="/haru/survey/2"
          element={
            <SurveyInterest
              interest={interest}
              setInterest={setInterest}
              birthYear={birthYear}
              gender={gender}
              userSurvey={userSurvey}
              setUserSurvey={setUserSurvey}
            />
          }
        />
        <Route path="/haru/survey/result" element={<SurveyResult />} />
        <Route path="/haru/main" element={<Main />} />
        <Route path="/haru/mypage" element={<Mypage />} />
        <Route path="/haru/wishlist" element={<WishList />} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
